import React from 'react';
import Select from 'react-select';
import './Header.css';

function Header() {

  return (
    <div className='headerBody'>
      <img src='Icons/home.png' alt='Home Icon' />
      <p>Hakkımızda</p>
      <h1>UniScore</h1>
      <p>İletişim</p>
      <img src='Icons/account.png' alt='Account Icon'/>

    </div>
  );    
}

export default Header;
